@Злата Анашкина, будьте умнее и хитрее. Почитайте о возможности отказаться от прививки. Вакцина - это препарат, который будет воздействовать на вашу иммунную с-му. Они бывают разные и точки приложения тоже разные. Не стану заниматься медицинским ликбезом, сами почитаете.  Вы можете отказаться в связи с  возможным появлением аллергической р-ции, вплоть до Анафилакт.шока, тк вы раньше плохо переносили вакцинацию и вам становилось не хорошо(кружилась голова, тошнило, была тяжесть в груди) Вы очень аллергичный человек!!! Или перед вакцинацией вы болели в легкой форме ОРЗ, перенесли на ногах и сейчас, да и потом, вы отказываетесь, тк вакцинацию лучше отложить в связи с возможностью заболеть, тк ваша иммун.с-ма снижена и нужно время на восстановление. Вы очень часто болеете ОРЗ, ОРВИ и для вас любая форма вакцинации смерти подобна. Скажите, что вакцинация проводится не всем и каждому, а строго индивидуально. Лучше прием у врача записать на камеру телефона. Вы имеете на это право, если считаете, что нарушаются ваши права, как пациента. Меня посадят за такие рекомендации!)))) Вы имеете право не прививаться по любым мотивам. Никто вас не имеет право заставлять. Читаете закон и ваши права и обязанности. 
Как только станут прививать всех поголовно, кто - то начнет болеть. Организм у всех разный и как он отреагирует на вакцинацию в массовом масштабе - никому не известно. Сам отказываюсь каждый год от вакцинации от гриппа, тк качество вакцины очень плохое. Один раз сделав прививку - сильно переболел и сказал сам себе, что это в последний раз. И еще, вирус постоянно мутирует. Где гарантии, что вакцина будет работать именно на этот штамм.
А самый лучший совет - валите из РФ. Здесь будущего нет. Я, лично, учу язык и собираюсь уезжать. Не в скором времени, но надо пытаться.

